function LeftSection({
    imageURL,
    productName,
    productDescription,
    tryDemo,
    learnMore,
    googlePlay,
    appStore,
    }) {
    return ( 
        <div className='container'>
            <div className='row'>
                <div className='col p-3'>
                    <img src={imageURL} alt=''/>
                </div>
                <div className='col'>
                    <h1>{productName}</h1>
                    <p>{productDescription}</p>
                    <a href={tryDemo}>Try Demo</a>
                    <a href={learnMore}>Leanr More</a>
                    <a href={googlePlay}></a>
                    <a href={tryDemo}>Try Demo</a>
                    <a href={tryDemo}>Try Demo</a>
                </div>
            </div>
        </div>
    );
}

export default LeftSection;
